import React, { useState } from 'react';

var e=0;

const Cunt =()=>{

const [ a ,b] = useState(0)
const [ c ,d] = useState(0)

const inc =()=>{
b(a +1)
}

const dec=()=>{
 d(c  -1)
}

    return(<> 
    
    <h1>{e+a+( c(d  -1))}</h1>
    <button onClick={inc}>Increment </button>
    <button onclick={dec}>Decreament</button>
    
    </>)
} ;
export default Cunt ;
